import React, { useState } from 'react'
import './Header.css'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
// import { Link } from 'react-router-dom';
import Home from './Home.jsx';
import Submission from './Submission'

const Header = () => {
    const [currentPage, setCurrentPage] = useState('home')

    const renderPage = () => {
        switch (currentPage) {
            case 'home':
                return <Home />;
            case 'submission':
                return <Submission />;
            default:
                return <Home />;
        }
    };
    return (
        <>
            <Navbar expand="lg" className="nav-bar">
                <Container fluid>
                    <Navbar.Brand href="#" className='nav__logo'>IC<span className='nav__logo-part'>DECT 2023</span></Navbar.Brand>
                    <Navbar.Toggle aria-controls="navbarScroll" />
                    <Navbar.Collapse id="navbarScroll">
                        <Nav
                            className="me-auto my-2 my-lg-0"
                            style={{ maxHeight: '100px' }}
                            navbarScroll
                        >
                                <Nav.Link onClick={() => setCurrentPage('home')} className="nav__link" href="#home">Home</Nav.Link>
                            <Nav.Link className='nav__link' href="#papers">About Institute</Nav.Link>
                            <Nav.Link className='nav__link' href="#papers">Call for papers</Nav.Link>
                                <Nav.Link onClick={() => setCurrentPage('Submission')} className='nav__link'>Submission</Nav.Link>
                            <Nav.Link className='nav__link' href="/RegistrationPage">Registration</Nav.Link>
                            <Nav.Link className='nav__link' href="#dates">Important Dates</Nav.Link>
                            <Nav.Link className='nav__link' href="#team">Conference Team</Nav.Link>
                            <Nav.Link className='nav__link' href="#venue">Venue</Nav.Link>
                            <Nav.Link className='nav__link' href="/GalleryPage">Gallery</Nav.Link>
                            <Nav.Link className='nav__link' href="#contact">Contact</Nav.Link>
                            {renderPage}
                        </Nav>
                    </Navbar.Collapse>
                </Container>
                
            </Navbar>

        </>
    )
}

export default Header
